import React, { Component } from "react";

class ProfileHeader extends Component {
  render() {
    console.log(this.props);

    const { handle } = this.props;
    return (
      <div className="row">
        <div className="col-md-10 mx-auto">
          <div className="card bg-info mb-4">
            <div className="card-body">
              <img
                src=""
                alt=""
                className="rounded-circle mb-3"
                style={{ width: "50px" }}
              />
              <div className="text-center text-white h4">Profile name</div>
              <p>
                <div className="text-center text-white">stutus</div>
              </p>
              <p>
                <div className="text-center text-white">location</div>
              </p>
              <p>
                <div className="text-center text-white">social links</div>
              </p>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
export default ProfileHeader;
